import React from 'react';

import classes from './BasketButton.module.css';

function BasketButton({ basket }) {


    return (
        <div className={classes.basketButton}>
            <svg role="img" xmlns="http://www.w3.org/2000/svg" classviewBox="0 0 64 64"><path fill="none" stroke-width="2" stroke-miterlimit="10" d="M44 18h10v45H10V18h10z"></path><path fill="none" stroke-width="2" stroke-miterlimit="10" d="M22 24V11c0-5.523 4.477-10 10-10s10 4.477 10 10v13"></path></svg>
        </div>
    );
}

export default BasketButton;
